// Given a binary circular array nums, return the minimum number of swaps required to group all 1's present in the array together at any location.
function minSwaps(nums: number[]): number {

    // find all the 1's in the array
    const oneIndices: number[] = [];
    let oneCount = 0;
    nums.forEach((num, i) => {
        if (num === 1) {
            oneCount++;
            oneIndices.push(i);
        }
    });

    // if there are no 1's, or there is only one 1, or the array is full, return 0 swaps needed
    if (oneCount === 0 || oneCount === 1 || oneCount === nums.length) return 0;

    // for each 1, check how many gaps need to be filled if it is set as the leftmost one
    let minGaps = oneCount; // worst case is that all 1's need to be swapped
    let gapsIfLeft = new Array(oneCount);
    for (let oneIndiceIndex = 0; oneIndiceIndex < oneIndices.length; oneIndiceIndex++) {
        const startingIndex = oneIndices[oneIndiceIndex];
        const previousIndex = oneIndices[oneIndiceIndex - 1];

        // the first time 1 we encounter we need to count every gap
        if (oneIndiceIndex === 0) {
            let gapCount = 0;
            for (let i = startingIndex; i < startingIndex + oneCount; i++) {
                if (nums[i] === 0) gapCount++; // do not worry about wrapping for the first one
            }
            gapsIfLeft[oneIndiceIndex] = gapCount;
            minGaps = Math.min(minGaps, gapCount);
            continue;
        }

        // for all other 1s we encounter, we only need to count the sliding window.
        let gapCount = gapsIfLeft[oneIndiceIndex - 1] - (startingIndex - previousIndex - 1);
        for (let i = previousIndex + oneCount; i < startingIndex + oneCount; i++) {
            if (nums[i % nums.length] === 0) gapCount++;
        }

        // update the minimum number of gaps needed
        gapsIfLeft[oneIndiceIndex] = gapCount;
        minGaps = Math.min(minGaps, gapCount);
    }

    return minGaps;
};

function expect(actual: number, value: number) {
    let result = value === actual;
    console.log(`Expected ${value}, got ${actual}, passed: ${result}\n`);
}

